import React from "react";
import Button from "./UI/Button";

const PagesList = () => {
  return (
    <div className={"page__menu"}>
      {pagesArray.map((page) => (
        <Button
          className={currentPage === page ? "page page__current" : "page"}
          onClick={() => setCurrentPage(page)}
          key={page}
        >
          {page}
        </Button>
      ))}
    </div>
  );
};

export default PagesList;
